INSERT INTO `v1_15d3a875523b226ff12aedfc55f67cb595840fde0902c28fd3272a6b37abeb46` VALUES (101, 1.5, 1, 122601, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 0.029, 0, 1, 0, 105, 110, 160, 1, 1);
INSERT INTO `v1_15d3a875523b226ff12aedfc55f67cb595840fde0902c28fd3272a6b37abeb46` VALUES (102, 2.5, 3, 122401, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 0.014, 0, 2, 1, 111, 105, 120, 2, 0);
INSERT INTO `v1_15d3a875523b226ff12aedfc55f67cb595840fde0902c28fd3272a6b37abeb46` VALUES (103, 2.5, 2, 122501, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 0.017, 1, 3, 0, 105, 110, 350, 3, 0);
INSERT INTO `v1_15d3a875523b226ff12aedfc55f67cb595840fde0902c28fd3272a6b37abeb46` VALUES (104, 1.5, 3, 107501, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 0.016, 0, 4, 1, 105, 110, 130, 4, 0);
INSERT INTO `v1_15d3a875523b226ff12aedfc55f67cb595840fde0902c28fd3272a6b37abeb46` VALUES (105, 2.5, 1, 107601, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 0.014, 0, 5, 0, 105, 110, 160, 5, 1);
INSERT INTO `v1_15d3a875523b226ff12aedfc55f67cb595840fde0902c28fd3272a6b37abeb46` VALUES (106, 3.5, 2, 107801, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 0.029, 1, 6, 0, 103, 120, 255, 6, 0);
INSERT INTO `v1_15d3a875523b226ff12aedfc55f67cb595840fde0902c28fd3272a6b37abeb46` VALUES (107, 3.5, 1, 110601, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 0.013, 0, 7, 0, 103, 120, 160, 7, 1);
INSERT INTO `v1_15d3a875523b226ff12aedfc55f67cb595840fde0902c28fd3272a6b37abeb46` VALUES (108, 2.5, 2, 110401, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 0.014, 1, 8, 0, 103, 110, 350, 8, 0);
INSERT INTO `v1_15d3a875523b226ff12aedfc55f67cb595840fde0902c28fd3272a6b37abeb46` VALUES (109, 1.5, 3, 110501, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 0.012, 0, 9, 1, 100, 105, 130, 9, 0);
INSERT INTO `v1_15d3a875523b226ff12aedfc55f67cb595840fde0902c28fd3272a6b37abeb46` VALUES (110, 2.5, 1, 115701, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 0.014, 0, 10, 0, 103, 105, 200, 10, 1);
INSERT INTO `v1_15d3a875523b226ff12aedfc55f67cb595840fde0902c28fd3272a6b37abeb46` VALUES (111, 2.5, 2, 113601, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 0.071, 1, 11, 0, 103, 105, 350, 11, 0);
INSERT INTO `v1_15d3a875523b226ff12aedfc55f67cb595840fde0902c28fd3272a6b37abeb46` VALUES (112, 1.5, 3, 107901, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 0.014, 0, 12, 1, 103, 120, 130, 12, 0);
INSERT INTO `v1_15d3a875523b226ff12aedfc55f67cb595840fde0902c28fd3272a6b37abeb46` VALUES (113, 1.5, 2, 108001, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 0.022, 0, 13, 0, 105, 110, 200, 13, 1);
INSERT INTO `v1_15d3a875523b226ff12aedfc55f67cb595840fde0902c28fd3272a6b37abeb46` VALUES (114, 2.5, 1, 110301, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 0.031, 0, 14, 0, 108, 110, 160, 14, 1);
INSERT INTO `v1_15d3a875523b226ff12aedfc55f67cb595840fde0902c28fd3272a6b37abeb46` VALUES (115, 0.5, 1, 107701, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 0.036, 0, 15, 1, 105, 110, 130, 15, 0);
INSERT INTO `v1_15d3a875523b226ff12aedfc55f67cb595840fde0902c28fd3272a6b37abeb46` VALUES (116, 3.5, 2, 113101, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 0.048, 1, 16, 0, 95, 110, 350, 16, 0);
INSERT INTO `v1_15d3a875523b226ff12aedfc55f67cb595840fde0902c28fd3272a6b37abeb46` VALUES (117, 1.5, 3, 113301, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 0.043, 0, 17, 1, 105, 105, 130, 17, 0);
INSERT INTO `v1_15d3a875523b226ff12aedfc55f67cb595840fde0902c28fd3272a6b37abeb46` VALUES (118, 1.5, 2, 113201, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 0.018, 0, 18, 1, 95, 105, 130, 18, 0);
INSERT INTO `v1_15d3a875523b226ff12aedfc55f67cb595840fde0902c28fd3272a6b37abeb46` VALUES (119, 2.5, 2, 117001, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 0.021, 0, 19, 0, 108, 110, 160, 19, 1);
INSERT INTO `v1_15d3a875523b226ff12aedfc55f67cb595840fde0902c28fd3272a6b37abeb46` VALUES (120, 2.5, 1, 113501, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 0.036, 1, 20, 0, 105, 110, 255, 20, 0);
INSERT INTO `v1_15d3a875523b226ff12aedfc55f67cb595840fde0902c28fd3272a6b37abeb46` VALUES (121, 2.5, 3, 113401, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 0.02, 1, 21, 0, 105, 105, 350, 21, 0);
INSERT INTO `v1_15d3a875523b226ff12aedfc55f67cb595840fde0902c28fd3272a6b37abeb46` VALUES (122, 2.5, 1, 110101, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 0.018, 0, 22, 1, 105, 110, 130, 22, 0);
INSERT INTO `v1_15d3a875523b226ff12aedfc55f67cb595840fde0902c28fd3272a6b37abeb46` VALUES (123, 3.5, 3, 110001, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 0.03, 0, 23, 0, 111, 105, 160, 23, 1);
INSERT INTO `v1_15d3a875523b226ff12aedfc55f67cb595840fde0902c28fd3272a6b37abeb46` VALUES (124, 1.5, 1, 117201, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 0.027, 0, 24, 1, 103, 110, 130, 24, 0);
INSERT INTO `v1_15d3a875523b226ff12aedfc55f67cb595840fde0902c28fd3272a6b37abeb46` VALUES (125, 3.5, 2, 117301, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 0.02, 0, 25, 0, 108, 105, 160, 25, 1);
INSERT INTO `v1_15d3a875523b226ff12aedfc55f67cb595840fde0902c28fd3272a6b37abeb46` VALUES (126, 2.5, 3, 117401, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 0.04, 1, 26, 0, 105, 110, 350, 26, 0);
INSERT INTO `v1_15d3a875523b226ff12aedfc55f67cb595840fde0902c28fd3272a6b37abeb46` VALUES (127, 3.5, 1, 117101, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 0.009, 1, 27, 0, 105, 110, 350, 27, 0);
INSERT INTO `v1_15d3a875523b226ff12aedfc55f67cb595840fde0902c28fd3272a6b37abeb46` VALUES (128, 3.5, 1, 122901, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 0.022, 1, 28, 0, 105, 120, 255, 28, 0);
INSERT INTO `v1_15d3a875523b226ff12aedfc55f67cb595840fde0902c28fd3272a6b37abeb46` VALUES (129, 2.5, 3, 122801, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 0.028, 0, 29, 1, 105, 110, 130, 29, 0);
INSERT INTO `v1_15d3a875523b226ff12aedfc55f67cb595840fde0902c28fd3272a6b37abeb46` VALUES (130, 3.5, 2, 122701, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 0.023, 0, 30, 0, 108, 105, 130, 30, 1);
